import { Label as BaseLabel, LabelTag, } from "@microsoft/fast-components-react-base";
import labelSchema from "./label.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { LabelStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Label = manageJss(LabelStyles)(BaseLabel);
export { Label, labelSchema, LabelTag, };
